import { Link } from 'react-router-dom';

function UserChaletsList({ chalets }) {
  if (chalets.length === 0) {
    return (
      <div className="no-chalets">
        <p>You don't have any chalets yet.</p>
        <Link to="/add-chalet" className="add-chalet-btn">
          Add Your First Chalet
        </Link>
      </div>
    );
  }

  return (
    <div className="chalets-grid">
      {chalets.map(chalet => (
        <div key={chalet.id} className="chalet-card">
          <div className="chalet-image">
            <img 
              src={chalet.image_url || '/default-chalet.jpg'} 
              alt={chalet.name} 
            />
          </div>
          <div className="chalet-info">
            <h3>{chalet.name}</h3>
            <p className="chalet-location">
              <span className="icon">üìç</span> {chalet.location}
            </p>
            <p className="chalet-price">
              <span className="icon">üí∞</span> ${chalet.price_per_night}/night
            </p>
            <div className="chalet-actions">
              <Link 
                to={`/chalet/${chalet.id}`} 
                className="view-btn"
              >
                View Details
              </Link>
              <button className="edit-btn">
                Edit
              </button>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default UserChaletsList;
